import React, {useState} from 'react';

function Collect() {
  const [meta, setMeta] = useState({});
  const data = async() => { 
    try { 
      const res = await fetch('https://yesno.wtf/api') 
      const out = await res.json() 
      setMeta(meta);
      console.log(out); 
    } catch(err) { 
      throw err
    } 
  }


  return (
    <div className="App">
      {data}
    </div>
  );
}

export default Collect;
